// utils/Data.js

import { useState } from "react";

const GetData = () => {
  const [lineData, setLineData] = useState([
    {
      id: Math.random() * 10,
      val: Math.random() * 10,
    },
    {
      id: Math.random() * 10,
      val: Math.random() * 10,
    },
    {
      id: Math.random() * 10,
      val: Math.random() * 10,
    },
    {
      id: Math.random() * 10,
      val: Math.random() * 10,
    },
  ]);

  return lineData;
};

export default GetData;
